                    "#text": "out on a short solo run today.  i was trying to stay ahead of the rain, and trying to get  closer to my 5000th find. it was getting a little dark when i made it to this location, so i only grabbed a few out of this area. (i def will be back to get the rest). i so made the hike to this one more difficult than i needed, but i spotted it right away. the cache is in good shape, but the zippy holding the log had a few holes in it. i had one in my pocket, so i just replaced it. thanks 1954gator for the hide, and the smiley for me."
