                  "groundspeak:finder": {
                    "@id": "3482959", 
                    "#text": "teamsteph"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "i took the day off to celebrate my bday, and what better way to celebrate it than caching, and better yet.... caching with my good friend trish from teambertin. we headed out to try to wipe out a few towns that new caches have popped up since the last time we visited them. we signed all logs ts/tb. i had been to this place before, but before i could get all of them it started raining. i knew it was gonna be hot today, so we got here, what i thought would be early enough but it wasn't and we left after only getting 2 more of them. we backed tracked from bluestem, and made our way here. we both spotted it right away. the cache is in good shape, and is 1 of many on the day for us. thanks 1954gator for the hide, the cool hiking area (just to hot to hike here anymore today), and of course the smiley for me."
                  }
