                  "groundspeak:finder": {
                    "@id": "2173871", 
                    "#text": "City Slicker"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Our intrepid team was passing through this area today.  We were on our way to Sedalia, Missouri from the Cincinnati, Ohio area.  We loaded caches near our route, although I was the only one that brought my GPS.  Luckily, I had loaded them on my in-car GPS as well and could see them coming up. I spotted this one on the radar and headed for it. When we got near, we got a good parking spot and began our trek to GZ. Once there, we spotted the container in short order. It is always a team effort as we select different areas to search around GZ to get the cache or the information we need, or, will cover for each other and look in areas each other has looked if we don't quickly find it. We extracted the sacred parchment from within, noted our visit thereupon, and returned it to it's place in the container. We then replaced the container as it was found.\nThanks for making a long trip easier to take, even though stopping for caches makes it even longer. At least we got a nice leg stretch out of it as well.  All is well here."
                  }
