            "groundspeak:state": "Illinois", 
            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>This is a cache much like <a href=\"http://coord.info/GC5W59V\">Skywalker</a> but more grand in it's scope. The cache is located on a the TREC trail. THERE IS NO DIRECT ACCESS TO THE TRAIL FROM INTERSTATE 70. You will need to get off I70 and hit the trail for a short hike but when you hit GZ you will get a great view of the cross and what continues to make Effingham grow will be right under your feet! (Placed with permission from TREC). BYOP.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>THE CACHE IS NOT ON INTERSTATE 70. The cache is a small magnetic that blends in with the material at GZ almost perfectly. There is some room for very small swag in the cache. You will need to decide if you want to approach from the east or the west. In both cases you are looking at a hike that is a little over 1/4 mile from parking to GZ. Once on the path it is all paved sidewalk so it is easy going. When you find the cache look south 1 1/3 miles away see <a href=\"http://www.roadsideamerica.com/story/10913\">the largest cross in the world</a> with <a href=\"http://coord.info/GC2D2WM\">another cache</a> near it.</p>\n<p>FTF will find a small present waiting for them!</p>\n\n<p>Additional Waypoints</p>P15X25B - West Approach<br />N 39\u00b0 07.277 W 088\u00b0 34.298<br />There is a small place off the road to park here.<br />P25X25B - East Approach<br />N 39\u00b0 07.262 W 088\u00b0 33.947<br />More parking here than on the west side and easier to get to.<br />"
            }, 
