                    "#text": "I'm guessing it wasn't meant to be all out in the open like we found it...not to mention, about to fall on the highway.  We removed the cancer stick someone left in there too... Unfortunately the cache still smells like a cigarette. I wish people would learn what appropriate swag is.  \nAll caches were in good shape unless otherwise specified. All logs signed as KB_1 or KB1. Thanks to the COs for bringing us here and placing/maintaining the caches.  #1437"
