              "@html": "True", 
              "#text": "<p>The ULTIMATE park N grab especially if you are driving a Tesla Model S or a Model X and you need a charge. \u00a0If you are not driving an electric car you may have to park a little farther away. \u00a0Placed with permission and BYOP.</p>"
