                    "#text": "11651\n\n[b][purple]Crowesfeat30[/b][/purple] & I headed east to Moonshine with the [b][purple]L Franks[/b][/purple] today, out to get a Moonburger with friends. After that we headed back west, caching along the way home, signing the logs as SLAGA 4.\n\nWe sure don't need the charging station for anything we drive, but the cache was easy to get. Thank you Voice of the Indians,\n\n[b][i][green]Strider[/b][/i][/green]\n[b][i][green]Glendale, Mo. [/b][/i][/green]\n[b][i][green]St. Louis Area Geocachers Assoc.  \nNew Members Welcome!\nhttp://www.geostl.com/joomla15/index.php [/b][/i][/green]"
