                    "#text": "Headed down to Effingham for some caching fun!  There was still enough daylight left to head out for a few, so we took a nice walk!  [8D]\n\nWe parked almost a mile away from this cache, but had a great hike to it!  What a great trail!  [^]   We were surprised at how many people we ran into tonight. The bridge over the Little Wabash was awesome!  [8D]   It was a stroke of luck to pick out a couple of caches in Effingham and end up with such a nice hike...right up our alley!  [;)]\n\nThanks, \"eagerbeans\" for the cache and for bringing us here!  [:D]"
