                    "@encoded": "False", 
                    "#text": "After finding a few caches in the area, I tried to cap off this run with this cache. I saw a few places where it looked like it belonged, but to no avail. What's worse is that a rather sizeable tree landed on the fence nearby. Nice place, but does need maintenance (at least the graveyard does)."
