                  "groundspeak:finder": {
                    "@id": "3482959", 
                    "#text": "teamsteph"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "i took the day off to celebrate my bday, and what better way to celebrate it than caching, and better yet.... caching with my good friend trish from teambertin. we headed out to try to wipe out a few towns that new caches have popped up since the last time we visited them. we signed all logs ts/tb. since we had aborted the trails in the altimont area because it got pretty hot. i was unsure if we would try the 3 on this part of the trail, or not. what the heck, you only live once (and of course we could always turn around. lol). we put some water in the back pack, and hit the road. we got as close as we could, but didn't spot the sign. the timber was really thick, and i wasn't for sure if we would be able to get in, esp since we both had shorts on. i deceided to walk further on up to see if the sign was there. nope didn't see it, but there was a much better opening, so we headed off. and after a little bit of walking we spotted the sign...... and the OMG hill. i didn't have to much of a problem with it. but trish def felt the burn. we got to the top, and spotted a rake. (doesn't look like it has been used here, as this cem needs a lot of tlc). i made the pretty quick find.  the log was mush, so i replaced it in a zippy. this was 1 of many on the day for us. thanks jennings.r for the hide, the exercise we got getting to it, and of course the smiley for me."
                  }
