            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>Freemanton Cemetery (also known as: Fremington Cemetery) is one of the few things in Keptown IL. \u00a0The sign at the entrance contains these lines from Longfellow:</p>\n<p>Lives of great men all remind us<br />\nWe can make our lives sublime<br />\nAnd, departing, leave behind us<br />\nFootprints on the sands of time.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p>This small cemetery has <a href=\"http://goo.gl/eJzuEE\">graves as far back as the late 1850</a> which predates most of the towns in this area. \u00a0Please respect the area and no night caching. \u00a0The cemetery road may not be all weather for all cars so consider this before entering the cemetery during times of heavy rain or snow. \u00a0BYOP.</p>\n<p>The cache has room for some small swag. \u00a0There is a small present for FTF. \u00a0Please re-hide as you found it.</p>"
            }, 
