              "#text": "<p>The cache is a tribute to my mother and father, Arlene and Wayne Nehaus whose final resting place is nearby. \u00a0Please respect the surroundings and no caching at night or during graveside services in the cemetery.\u00a0At certain times during the day you may have to exercise some stealth due to activity in the nearby ag services business. \u00a0The coords are where the bison tube containing the log is at and could be a little tricky. \u00a0Keep in mind the old saying \"You can't get there from here; you have to go somewhere else and start.\" \u00a0You will find it if you stick to it. \u00a0Please rehide exactly as you found it so the next cacher can enjoy it!</p>\n<p>Hidden with permission.</p>"
