            "groundspeak:short_description": {
              "@html": "True", 
              "#text": "<p>This should be an easy park and grab and should be fairly muggle free. \u00a0The cach is at the location of the Old Starlite Drive-In between Effingham and T-Town IL. \u00a0Cache is small so bring your own pen and get ready to sign the log. Placed with permission of land owner.</p>"
            }, 
            "groundspeak:long_description": {
              "@html": "True", 
              "#text": "<p><img alt src=\"http://photos.cinematreasures.org/production/photos/9642/1309827927/large.jpg?1309827927\" style=\"height:372px;margin:3px 2px;width:640px;\" /></p>\n<p>The Rustic Starlite, also known as just the Starlite Drive-In, opened around 1950, and was located along Route 40 East of Effingham. The drive-in could accomodate 400 cars, and was part of the Frisina Amusements chain. It closed in the early-1980\u2019s. \u00a0If you know what you are looking for you can make out where the screen was since one of the supports is still there. \u00a0In the distance you can still see the concession stand / projection house so you can get an idea of the size of the place. \u00a0The sign (pictured above) was rescued and is now located in front of Mid America Motorworks which is about 3 miles due north (as the crow flies) from the this location. \u00a0</p>"
            }, 
            "groundspeak:encoded_hints": "Don't see red when you are looking for this one.", 
