                  "groundspeak:type": "Found it", 
                  "groundspeak:finder": {
                    "@id": "453288", 
                    "#text": "go-purdue"
                  }, 
                  "groundspeak:text": {
                    "@encoded": "False", 
                    "#text": "Today, I drove over to Illinois to work on a few counties I still need for that state.  I had intended on getting eleven counties today, but I did start later than I wanted to and I had to shave off a couple from my plan.  I had a nice time exploring the countryside.  I was able to visit towns I've never been to before.  I saw a statue of a white squirrel (but sadly, I didn't see any white squirrels), I saw some cute towns, a turtle in the woods by a cemetery, and a band shell/shelter house close to a courthouse -- very throw back.  I was able to dodge the rain that moved across the states today -- it poured in Indianapolis today, but I wasn't there -- I was in Southern Illinois!  \n\nI found a couple of tricky caches, but for the most part the caches were easy ones that I targeted.  It wasn't a very high step count day for me due to all of the driving -- probably drove for over 12 hours today.  Yes, I might have a problem.  It's not a problem for me though...  I had a few DNF's -- one at an old bank in Mill Shoals -- very cool building that isn't used as a bank anymore, and people's houses and trailers are close to it now, strange juxtaposition.\n\nA big thank you to the cache owners for putting out caches for me to go get!  It was late when I got this one -- time to head back!"
                  }
